<!doctype html><html><head><meta charset="UTF-8"><meta name="viewport" content="width=device-width,initial-scale=1"><meta name="google" value="notranslate"><link rel="shortcut icon" href="static/favicon.ico"><title>Smalruby: Compatibility Testing</title><script src="static/javascripts/setup-opal.js"></script><style><!--
        .ruby-error {
            background-color: pink;
            position: absolute;
            z-index: 3;
        }
        --></style><script defer="defer" src="compatibilitytesting.js"></script></head><body><script>if ('serviceWorker' in navigator) {
        window.addEventListener('load', function () {
          navigator.serviceWorker.register('./service-worker.js').then(function (registration) {
            console.log('PWA worker registration successful', registration.scope);
          }, function (err) {
            console.log('PWA worker registration failed', err);
          }).catch(function (err) {
            console.log(err);
          });
        });
      } else {
        console.log('Service Worker is not supported by browser.');
      }</script></body></html>
